import express from 'express';
const app = express();

app.get('/api', (req, res) => {  // Route handler
    res.send('Tune Up!');
});

app.get('/api/spotify/get_categories', (req, res) => {
    res.send({'pop rap': 'drake'});
});

app.listen(3000, () => {
    console.log('Listening on port 3000...');
})

